def moment_4_KIN_MS(q2cut, par, hqe, wc, **kwargs):
    """ Central moment of the q2 spectrum. Contributions from New Physics. Moment n. 4 """
    Q2=q2cut/par.mbkin**2
    r=par.mcMS/par.mbkin
    mu0=par.scale_mcMS/par.mbkin
    muWC=par.scale_mbkin/par.mbkin
    api=par.alphas/math.pi

    rhoD=hqe.rhoD/par.mbkin**3
    rhoLS=hqe.rhoLS/par.mbkin**3
    muG=hqe.muG/par.mbkin**2

    sqrtq2=math.sqrt(1-2*Q2+Q2**2-2*r**2-2*Q2*r**2+r**4)
    logq2 =math.log((1-Q2+r**2-sqrtq2)/(1-Q2+r**2+sqrtq2))

    res = 0
    if wc.ReVL != 0:
      resNP = 0
      resNP +=(0)
      res += resNP*wc.ReVL

    if wc.ReVR != 0:
      resNP = 0
      resNP +=(0)
